    if (lstat(argv[1], &st) < 0) {
        perror(argv[1]);
        exit(1);
    }

    if (S_ISREG(st.st_mode))
        type = "regular";
    else if (S_ISDIR(st.st_mode))
        type = "directory";
    else
        type = "other";

    if ((st.st_mode & S_IRUSR))
        readok = "yes";
    else
        readok = "no";

    printf("type: %s, read: %s\n", type, readok);

    exit(0);
}

